Station calibration correction flag.
Indicates results of validation of the station calibration value.
   0 = Unable to correct; 
   1 = Validated, no change; 
   2 = Validated, changed uplink; 
   3 = Validated, changed downlink; 
   4 = Validated, changed both uplink and downlink

